import Context from "../../context/Context";
import ShowUsers from "./ShowUsers";

export default function Home() {
    const socket = useContextSelector(Context, (item) => item.socket);

    useEffect(() => {
        console.log(socket.id);
    }, []);

    return <>this is home.</>;
}
